import Footer from "./components/Footer";
import Header from "./components/Header";
import withDashboardContext from "./hoc/withDashboardContext";
import { useState } from "react";
import "./NewMember.css";
import axios from "axios";

const NewMember = () => {
  const [email, setEmail] = useState("");
  const [fullName, setFullName] = useState("");
  const [password, setPassword] = useState("");

  const handleSubmit = async (event: React.FormEvent<HTMLFormElement>) => {
    event.preventDefault();
    const response = await axios
      .post(
        "http://localhost:8085/admin/user",
        {
          fullName,
          email,
          password,
        },
        {
          headers: {
            Authorization: `Bearer ${localStorage.getItem("accessToken")}`,
          },
        }
      )
      .catch((error) => {
        alert(error.response.data.message);
      });
  };

  return (
    <div>
      <Header />
      <div
        style={{
          background: "rgb(204,204,204,.5)",
          display: "flex",
          justifyContent: "space-around",
          height: "100vh",
        }}
      >
        <form onSubmit={(event) => handleSubmit(event)} className="newUserForm">
          <p>Enter User Details</p>

          <div>
            <input
              type="name"
              placeholder="Enter Full Name"
              required
              value={fullName}
              onChange={(event) => setFullName(event.target.value)}
            />
          </div>

          <div>
            <input
              type="email"
              placeholder="Enter Email"
              required
              value={email}
              onChange={(event) => setEmail(event.target.value)}
            />
          </div>

          <div>
            <input
              type="password"
              placeholder="Enter Password"
              required
              value={password}
              onChange={(event) => setPassword(event.target.value)}
            />
          </div>

          <div style={{ textAlign: "center" }}>
            <button>Submit</button>
          </div>
        </form>
      </div>
      <Footer />
    </div>
  );
};

export default withDashboardContext(NewMember);
